import component from '../component'

@component
export default class Icon {
  static defaultProps = {
    size: 16,
  }

  render() {
    const { color, size, full, ...props } = this.props
    let { name } = this.props
    const fullName = `${name}Full`

    if (full && icons[fullName]) {
      name = `${name}Full`
    }

    return (
      <icon style={{ width: size, height: size, fill: color }} {...props}>
        {icons[name]}
      </icon>
    )
  }

  style = {
    svg: {
      shapeRendering: 'geometricPrecision',
    },
  }
}

